import { Box } from '@mui/material';
import React from 'react';

const HomePage = () => {
  return <Box width={'100%'} height={'100%'} margin="auto" marginTop={2}> 
    <Box margin={'auto'} width={'80%'} height={'40%'} padding={2}>
        <img src="https://deadline.com/wp-content/uploads/2021/12/Brahmastra-Part-One-Shiva.jpg?crop=0px%2C291px%2C1080px%2C606px&resize=681%2C383" 
            alt="Brahmastra" width={'100%'} height={'100'} />
    </Box>
  </Box>
};

export default HomePage;
